import React from 'react'
import {useParams} from "react-router-dom";


const ProjectItem = ({project}) => {
    return (
        <tr>
            <td>
                {project.name}
            </td>
            <td>
                {project.link}
            </td>
            <td>
                {project.users}
            </td>
        </tr>
    )
}

const ProjectList = ({project}) => {
    return (
        <table>
            <th>
                project name
            </th>
            <th>
                project link
            </th>
            <th>
                project users
            </th>
            {project.map((project) => <ProjectItem project={project} />)}
        </table>
    )
}

export default ProjectList
